import styled from 'styled-components';

export const AdminPageStyled = styled.div`
  margin: 20px;

  .admin__posts-container {
    width: 100%;
    display: flex;
    justify-content: space-between;
  }

  .admin__posts-container__button-container {
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;

    button {
      color: #444;
      border: none;
      display: block;
      height: 50px;
      background-color: #444;
      cursor: pointer;
      width: 100%;
      padding: 20px;
      margin: 10px;
    }
  }
`;
